INSERT INTO `recipe` VALUES (1,'20250220 155330','USER ruddms1522@naver.com','N','20250220 155330','USER ruddms1522@naver.com','닭다리살을 약한 불에 굽고 스리라차 소스에 찍어먹는다. \n닭다리살만 먹으면 탄수화물이 부족하니까 야채김밥을 전자레인지에 5분 돌린다.\n존맛~!','배부른 다이어트 식단',20,1),(2,'20250220 155443','USER ruddms1522@naver.com','N','20250220 155443','USER ruddms1522@naver.com','풀만 먹으면 살이 빠진다!','무조건 살빠지는 레시피',1,1),(57,'20250221 000946','USER test@user.com','N','20250221 000946','USER test@user.com','닭 다리 살은 한 입 크기로 썰어줍니다. 썰어 놓은 닭 다리 살에 소금 1/2 작은 술 후춧가루 조금 우유 4 큰 술을 넣고 조물조물 한 다음 30분 정도 재워줍니다. 전분가루 8 큰 술 물 3 큰 술을 넣고 전분물을 만들어 줍니다. 팬이 달궈지면 반죽해 놓은 닭 다리 살을 넣고 얇게 펴줍니다.\n','이찬원 닭전',15,2),(58,'20250221 001237','USER test@user.com','N','20250221 001237','USER test@user.com','소고기를 적당한 크기로 썰어요.\n토마토, 감자는 크게 깍둑 썰어요.\n양배추, 버섯, 양파, 당근은 한 입 크기로 썰어요.\n큰 냄비에 버터, 소고기를 넣고 볶아요.\n\n\n감자, 당근을 넣고 볶아요.\n썰어 둔 나머지 채소들도 모두 넣고 볶아요.\n홀토마토 통조림을 손으로 으깨 넣어요.\n홀토마토통조림을 넣으면 맛이 더 진해져요!\n\n\n물을 붓고 월계수잎을 넣은 다음 뚜껑을 덮고 약불로 20~30분간 끓여요.\n카레가루, 후추를 넣고 10분간 더 끓여 완성해요.','마녀수프',60,1);
/*!40000 ALTER TABLE `recipe` ENABLE KEYS */;
UNLOCK TABLES;

